import axios from 'axios';
import React, { useEffect, useState } from 'react'

const Content = () => {
  const [data,setData] = useState({})
  useEffect(() =>{
    ( async () => {
      const {subdata} = await axios.get('http://localhost:3000/content')
      setData(subdata)
    }
    )();
  },[])
  return (
    <div>
      content {data}
    </div>
  )
}

export default Content
